import http from "../http-common";
import axios from "axios";

const templ = (file: File): Promise<any> => {
  let formData = new FormData();

  formData.append("file_name_input","generated_docx_3.doc");

  return http.post("/tmp/templ", formData);
};

const scan = (filename: string): Promise<any> => {
  // return http.post("/tmp/scan", {file_name_input: filename});
  return axios.post('http://localhost:1337/tmp/scan', {file_name_input: filename})
};


const FileUploadService = {
  templ,
  scan,
};

export default FileUploadService;
